import React, { useState } from 'react';
import { useAppContext } from '../../context/AppContext';
import './Staff.css';

const Staff = () => {
  const { staffList, setStaffList } = useAppContext();
  const [selectedStaff, setSelectedStaff] = useState(null);

  const ratingOptions = ['CPL', 'PPL', 'MEA', 'IR', 'FIR'];
  const instructorCategories = ['Grade 1', 'Grade 2', 'Grade 3'];

  const handleStaffUpdate = (updatedStaff) => {
    setStaffList(staffList.map(staff => 
      staff.id === updatedStaff.id ? updatedStaff : staff
    ));
  };

  const handleAddStaff = () => {
    const newStaff = {
      id: `staff${staffList.length + 1}`,
      firstName: '',
      lastName: '',
      email: '',
      phone: '',
      ratings: [],
      instructorCategory: '',
      active: true
    };
    setStaffList([...staffList, newStaff]);
    setSelectedStaff(newStaff);
  };

  return (
    <div className="staff-container">
      <div className="staff-list">
        <h2>Staff List</h2>
        <button onClick={handleAddStaff}>Add New Staff</button>
        {staffList.map(staff => (
          <div 
            key={staff.id} 
            className={`staff-item ${selectedStaff?.id === staff.id ? 'selected' : ''}`}
            onClick={() => setSelectedStaff(staff)}
          >
            {staff.firstName} {staff.lastName}
          </div>
        ))}
      </div>
      
      {selectedStaff && (
        <div className="staff-details">
          <h2>Staff Details</h2>
          <form>
            <div className="form-group">
              <label>First Name:</label>
              <input
                type="text"
                value={selectedStaff.firstName}
                onChange={(e) => handleStaffUpdate({
                  ...selectedStaff,
                  firstName: e.target.value
                })}
              />
            </div>
            
            <div className="form-group">
              <label>Last Name:</label>
              <input
                type="text"
                value={selectedStaff.lastName}
                onChange={(e) => handleStaffUpdate({
                  ...selectedStaff,
                  lastName: e.target.value
                })}
              />
            </div>

            <div className="form-group">
              <label>Email:</label>
              <input
                type="email"
                value={selectedStaff.email}
                onChange={(e) => handleStaffUpdate({
                  ...selectedStaff,
                  email: e.target.value
                })}
              />
            </div>

            <div className="form-group">
              <label>Ratings:</label>
              <select
                multiple
                value={selectedStaff.ratings}
                onChange={(e) => handleStaffUpdate({
                  ...selectedStaff,
                  ratings: Array.from(e.target.selectedOptions, option => option.value)
                })}
              >
                {ratingOptions.map(rating => (
                  <option key={rating} value={rating}>{rating}</option>
                ))}
              </select>
            </div>

            <div className="form-group">
              <label>Instructor Category:</label>
              <select
                value={selectedStaff.instructorCategory}
                onChange={(e) => handleStaffUpdate({
                  ...selectedStaff,
                  instructorCategory: e.target.value
                })}
              >
                <option value="">Select Category</option>
                {instructorCategories.map(category => (
                  <option key={category} value={category}>{category}</option>
                ))}
              </select>
            </div>
          </form>
        </div>
      )}
    </div>
  );
};

export default Staff;
